svg.script:


var svgNS = "http://www.w3.org/2000/svg";


var gears = {};
var speedFactor = 50; // Pixel pr sec

var forEach = function(list, f) {
  for (var i=0; i < list.length; i++) {
    f(list[i], i);
  }
};

function init(evt) {

  if ( window.svgDocument == null ) {
    svgDoc = evt.target.ownerDocument;
  }


  forEach(svgDoc.getElementsByTagName('path'), function(el, index) {

    var parentTag = el.parentElement.tagName;
    var parentId = el.parentElement.id;

    var dir = null;

    if (parentTag == 'g' && parentId) {
      // Check for existing direction...
      if (!gears[parentId]) {
        // Random direction
        gears[parentId] = (Math.random() > 0.5) ? -1 : 1;
      }
      dir = gears[parentId];
      addRotateTransform(el, null, dir);
    }

  });


}


function addRotateTransform(el, dur, dir) {
  var a = svgDoc.createElementNS(svgNS, "animateTransform");

  var bb = el.getBBox();
  var cx = bb.x + bb.width/2;
  var cy = bb.y + bb.height/2;

  var r = (bb.width + bb.height) / 4;
  var cir = 2 * Math.PI * r;

  // Use default duration or calculate one...
  if (dur !== 1*dur) dur = cir / speedFactor; // get result in sec

  // Use random or absolute direction
  if (dir !== 1*dir) dir = (Math.random() > 0.5) ? -1 : 1;

  a.setAttributeNS(null, "attributeName", "transform");
  a.setAttributeNS(null, "attributeType", "XML");
  a.setAttributeNS(null, "type", "rotate");
  a.setAttributeNS(null, "dur", dur + "s");
  a.setAttributeNS(null, "repeatCount", "indefinite");
  a.setAttributeNS(null, "from", "0 "+cx+" "+cy);
  a.setAttributeNS(null, "to", 360*dir+" "+cx+" "+cy);

  el.appendChild(a);
  a.beginElement();
}
